// Styles
import "./styles.css";

const UnderConstruction = () => {
	return (
		<main id="projects">
			<p className="underConstruction">
				Denne delen er under konstruksjon. I mellomtiden sjekk ut min github for å se på mine
				prosjekter.
			</p>
		</main>
	);
};

export default UnderConstruction;
